import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Start from "./pages/Start";
import Simulator from "./pages/Simulator";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route index element={<Start />}></Route>
          <Route index element={Simulator}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
